import React from 'react'
import "./Menucart.css"
import Menudisplay from './Menudisplay'

function Menudata({Menudata}) {
  console.log(Menudata)
  const Games=Menudata.map((game)=>{
    return(<div key={game.id}><Menudisplay data/></div>)
  })
  return (
  <>{Games}</>
  )
}

export default Menudata
